class ProductListAVTestCase(APITestCase):
    def setUp(self):
        self.user = Account.objects.create_user(
            first_name = 'Cheikh',
            last_name = 'Diop',
            username='testcase',
            email='cheikhdiouf035@gmail.com',
            password='password123',
        )
        self.token, created = Token.objects.get_or_create(user=self.user)
        self.client.credentials(HTTP_AUTHORIZATION='Token ' + self.token.key)
        self.url = reverse('product-list-create')

        # Create a category instance
        self.category = Category.objects.create(category_name="Super cent", slug="super-cent")
        
        # Ensure the user is an admin
        self.user.is_active = True
        self.user.is_staff = True
        self.user.save()

        # Create a product instance for updating
        self.product = Product.objects.create(
            product_name="product_name",
            slug="product_name",
            description="description",
            price=12000,
            stock=100,
            category=self.category
        )
        self.product_detail_url = reverse('product-detail', args=[self.product.pk])  # Adjust the URL name if necessary

        # Create color variation instance
        self.color_variation = Variation.objects.create(
            product=self.product,
            variation_category="color",
            variation_value="Green",
            is_active=True
        )

        # Create size variation instance
        self.size_variation = Variation.objects.create(
            product=self.product,
            variation_category="size",
            variation_value="L",
            is_active=True
        )

        self.variation_create_url = reverse('variation-list-create') 
        # self.variation_detail_url = reverse('variation-detail', args=[self.variation.pk])  # Adjust the URL name if necessary

        self.productgallery = ProductGallery.objects.create(
            product = self.product,
            image = 'http://testserver/media/photo/produts/2241cf9b-f58a-405c-9a11-08b477b397f5.png'
        )

        self.productgallery_list_url = reverse('productgallery-list-create') 
        self.productgallery_detail_url = reverse('productgallery-detail', args=[self.productgallery.pk]) 

        # Create a review rating instance for listing
        self.reviewrating = ReviewRating.objects.create(
            product= self.product,
            user= self.user,
            subject="description of the first product",
            review="This is the description of the first product",
            rating= 4.5,
        )
        self.reviewrating_url = reverse('review-list', args=[self.product.pk])  # Adjust the URL name if necessary
        self.reviewrating_create_url = reverse('review-create', args=[self.product.pk])  # Adjust the URL name if necessary

    def test_variation_list(self):
        response = self.client.get(self.variation_create_url)
        self.assertEqual(response.status_code, status.HTTP_200_OK)
        self.assertGreaterEqual(len(response.data), 1)
    
    def test_variation_detail(self):
        variation_detail_url = reverse('variation-detail', args=[self.color_variation.pk])
        response = self.client.get(variation_detail_url)
        self.assertEqual(response.status_code, status.HTTP_200_OK)
        self.assertEqual(response.data['variation_value'], self.color_variation.variation_value)

    def test_variation_create(self):
        color_data = {
            "product" : self.product.pk,
            "variation_category" : "color",
            "variation_value" : "yellow",
            "is_active" : True
        }

        response = self.client.post(self.variation_create_url, color_data, format='json')
        print(response.data)
        self.assertEqual(response.status_code, status.HTTP_201_CREATED)
        self.assertEqual(response.data['variation_category'], "color")
        self.assertEqual(response.data['variation_value'], "yellow")

        size_data = {
            "product" : self.product.pk,
            "variation_category" : "size",
            "variation_value" : "X",
            "is_active" : True
        }

        response = self.client.post(self.variation_create_url, size_data, format='json')
        print(response.data)
        self.assertEqual(response.status_code, status.HTTP_201_CREATED)
        self.assertEqual(response.data['variation_category'], "size")
        self.assertEqual(response.data['variation_value'], "X")


